    public static void main(String[] args) {
        int count = 0;
        int previous = 0;
        String RLE = "";
        int LongestPattern = 0;
        int PatternAmount = 0;

        for (int i = 0; i < 10000; i++) {
            if (pattern[i] != previous) {
                RLE = RLE + count + ",";
                count = 0;
                previous = pattern[i];
                if (PatternAmount >= LongestPattern) {
                    LongestPattern = PatternAmount;
                    PatternAmount = 0;
                } Else:  PatternAmount = 0; {
                }

            }
            count++;
            PatternAmount ++;

        }

        RLE = RLE + count;

        System.out.println(RLE);

        int NoOfOnes = 0;
        int NoOfZeros = 0;

        for (int i = 0; i < 100; i++) {
            for (int j = 0; j < 100; j++) {
                if (pattern[j + i * 100] == 1) {
                    System.out.print("■");
                    NoOfOnes = NoOfOnes + 1;
                } else {
                    System.out.print("□");
                    NoOfZeros += 1;
                }

            }
            System.out.println();
        }

        System.out.println("Pattern length before compression " + pattern.length + " bits");
        System.out.println("There are " + NoOfOnes + " Ones in the picture!");
        System.out.println("There are " + NoOfZeros + " Zeros in the picture!");
        System.out.println("The Longest pattern is " +LongestPattern+ "!");
    }


